INSERT INTO PSER_TC_REPORTE_GENERICO (ID_REPORTE_GENERICO,ID_SUBPROCESO,ID_TIPO_REPORTE,CH_NOMBRE_REPORTE,NU_ACTIVO,CH_CONSULTA,CH_ESQUEMA,CH_ENCABEZADO,NU_FILTRO_NSS,NU_FILTRO_CURP,NU_FILTRO_RANGO_FC,NU_FILTRO_ID_PROCESAR,FC_CONTROL,CH_USUARIO_MODIFICADOR,ID_REPORTE_GENERICO_PADRE,NU_ORDEN,CH_NOMBRE_ARCHIVO_REPORTE, CH_URL) VALUES (1034,910,3194,'SUBREPORT_DATA_REPORTE_U',1,'SELECT /*+PARALLEL(5)*/ cv_afore   AS chAfore, trans.NU_RET97_TRA   AS nuRet97Tra, trans.NU_CV_CUOTA_ESTA_TRA AS nuCvCuotaEstaTra, trans.NU_CUOTA_SO_TRA  AS nuCuotaSoTra, trans.NU_RET92_IMSS_TRA  AS nuRet92ImssTra, ''0.00''   AS nuViv97Tra, ''0.00''   AS nuPartViv97Inf, mov.NU_MONTO_RETIRO97  AS nuMontoRetiro97, mov.NU_MONTO_CV  AS nuMontoCv, mov.NU_MONTO_CUOTA_SOCIAL  AS nuMontoCuotaSocial, mov.NU_MONTO_RETIRO92  AS nuMontoRetiro92, ''0.00''   AS nuMontoVivienda97, ''0.00''   AS nuPartViv97InfMov FROM (SELECT /*+PARALLEL(5)*/ CONCAT(CONCAT(ta.cv_afore,'' - ''),ta.CH_DESC_AFORE) AS cv_afore, SUM( ct.NU_RET97_TRA) NU_RET97_TRA, SUM( ct.NU_CV_CUOTA_ESTA_TRA) NU_CV_CUOTA_ESTA_TRA, SUM( ct.NU_CUOTA_SO_TRA )NU_CUOTA_SO_TRA, SUM( ct.NU_RET92_IMSS_TRA) NU_RET92_IMSS_TRA, SUM( ct.NU_VIV_97_TRA ) NU_VIV_97_TRA, SUM( ct.NU_PART_VIV97_INF ) NU_PART_VIV97_INF FROM RETI_TR_CONF_TRANSFERENCIA ct INNER JOIN NSAR_TC_AFORE ta ON ct.id_procesar_afore= ta.id_procesar WHERE TRUNC(FC_LIQUIDACION) BETWEEN PARSEDATETIME(?1,''DD/MM/YYYY'') AND PARSEDATETIME(?2,''DD/MM/YYYY'')  AND CH_DIAGNOSTICO_AFORE IN (''501'',''590'') AND CV_TIPO_RETIRO = ''U'' group by CONCAT(CONCAT(ta.cv_afore,'' - ''),ta.CH_DESC_AFORE) ) trans left join (SELECT /*+PARALLEL(5)*/ CONCAT(CONCAT(CH_AFORE,'' - ''),af.CH_DESC_AFORE) AS cv_af, SUM( NU_MONTO_RETIRO97 ) NU_MONTO_RETIRO97, SUM( NU_MONTO_CV ) NU_MONTO_CV, SUM( NU_MONTO_CUOTA_SOCIAL ) NU_MONTO_CUOTA_SOCIAL, SUM( NU_MONTO_RETIRO92 ) NU_MONTO_RETIRO92, SUM( NU_MONTO_VIVIENDA97 ) NU_MONTO_VIVIENDA97, SUM( (SELECT /*+PARALLEL(5)*/ NU_VALOR_FACTOR FROM TRAN_TC_FACTOR_CONVERSION WHERE CV_TIPO_FACTOR = ''04'' AND FC_VALOR_FACTOR  = PARSEDATETIME(?3,''DD/MM/YYYY'') )*NU_MONTO_VIVIENDA97 ) NU_MONTO_VIVIENDA92 FROM RETI_TR_MOVIMIENTO_IMSS INNER JOIN NSAR_TC_AFORE af ON CH_AFORE = af.CV_AFORE WHERE TRUNC(FC_MOVIMIENTO) BETWEEN PARSEDATETIME(?1,''DD/MM/YYYY'') AND PARSEDATETIME(?2,''DD/MM/YYYY'')  AND CV_MOVIMIENTO_IMSS IN (''290'',''295'') AND CH_DIAGNOSTICO_RCV IN (''501'',''590'') group by CONCAT(CONCAT(CH_AFORE,'' - ''),af.CH_DESC_AFORE) order by CONCAT(CONCAT(CH_AFORE,'' - ''),af.CH_DESC_AFORE) ) mov ON trans.cv_afore = mov.cv_af ORDER BY cv_afore ASC','PROCNSARD','cv_afore,nuRet97Tra,nuCvCuotaEstaTra,nuCuotaSoTra,nuRet92ImssTra,nuViv97Tra,nuPartViv97Inf,nuMontoRetiro97,nuMontoCv,nuMontoCuotaSocial,nuMontoRetiro92,nuMontoVivienda97,nuPartViv97InfMov',0,0,0,0,PARSEDATETIME('14/01/20','DD/MM/YY'),'HJRAMIRE',1029,5,null, '');
INSERT INTO PSER_TC_REPORTE_GENERICO (ID_REPORTE_GENERICO,ID_SUBPROCESO,ID_TIPO_REPORTE,CH_NOMBRE_REPORTE,NU_ACTIVO,CH_CONSULTA,CH_ESQUEMA,CH_ENCABEZADO,NU_FILTRO_NSS,NU_FILTRO_CURP,NU_FILTRO_RANGO_FC,NU_FILTRO_ID_PROCESAR,FC_CONTROL,CH_USUARIO_MODIFICADOR,ID_REPORTE_GENERICO_PADRE,NU_ORDEN,CH_NOMBRE_ARCHIVO_REPORTE, CH_URL) VALUES (1033,910,3194,'SUBREPORT_DATA_REPORTE_C',1,'SELECT /*+PARALLEL(5)*/ cv_afore  AS chAfore, trans.NU_RET97_TRA  AS nuRet97Tra, trans.NU_CV_CUOTA_ESTA_TRA AS nuCvCuotaEstaTra, trans.NU_CUOTA_SO_TRA AS nuCuotaSoTra, ''0.00''  AS nuRet92ImssTra, trans.NU_VIV_97_TRA  AS nuViv97Tra, trans.NU_PART_VIV97_INF AS nuPartViv97Inf,  mov.NU_MONTO_RETIRO97  AS nuMontoRetiro97, mov.NU_MONTO_CV AS nuMontoCv, mov.NU_MONTO_CUOTA_SOCIAL AS nuMontoCuotaSocial, ''0.00''  AS nuMontoRetiro92, mov.NU_MONTO_VIVIENDA97 AS nuMontoVivienda97, mov.NU_MONTO_VIVIENDA92 AS nuPartViv97InfMov FROM ( SELECT /*+PARALLEL(5)*/(ta.cv_afore || '' - '' || ta.CH_DESC_AFORE) AS cv_afore, SUM( ct.NU_RET97_TRA) NU_RET97_TRA, SUM( ct.NU_CV_CUOTA_ESTA_TRA) NU_CV_CUOTA_ESTA_TRA, SUM( ct.NU_CUOTA_SO_TRA )NU_CUOTA_SO_TRA, SUM( ct.NU_RET92_IMSS_TRA) NU_RET92_IMSS_TRA, SUM( (CASE ct.CV_ESTATUS_VIVIENDA WHEN ''1'' THEN ct.NU_VIV_97_TRA  ELSE 0.00 END) ) NU_VIV_97_TRA, SUM( (CASE ct.CV_ESTATUS_VIVIENDA WHEN ''1'' THEN ct.NU_PART_VIV97_INF ELSE 0.00 END) ) NU_PART_VIV97_INF FROM RETI_TR_CONF_TRANSFERENCIA ct INNER JOIN NSAR_TC_AFORE ta ON ct.id_procesar_afore  = ta.id_procesar where TRUNC(FC_LIQUIDACION) BETWEEN PARSEDATETIME(?1,''DD/MM/YYYY'') AND PARSEDATETIME(?2,''DD/MM/YYYY'') AND CH_DIAGNOSTICO_AFORE IN (''501'',''590'') AND CV_TIPO_RETIRO  = ''C'' GROUP BY (ta.cv_afore || '' - '' || ta.CH_DESC_AFORE) ) trans left join ( SELECT /*+PARALLEL(5)*/CH_AFORE || '' - ''|| af.CH_DESC_AFORE AS cv_af, SUM( NU_MONTO_RETIRO97 ) NU_MONTO_RETIRO97, SUM( NU_MONTO_CV ) NU_MONTO_CV, SUM( NU_MONTO_CUOTA_SOCIAL ) NU_MONTO_CUOTA_SOCIAL, SUM( NU_MONTO_RETIRO92 ) NU_MONTO_RETIRO92, SUM( (CASE CH_RESULTADO_VIVIENDA WHEN ''01'' THEN NU_MONTO_VIVIENDA97 ELSE 0.00 END)) NU_MONTO_VIVIENDA97, SUM( (CASE CH_RESULTADO_VIVIENDA WHEN ''01'' THEN ((SELECT /*+PARALLEL(5)*/NU_VALOR_FACTOR FROM TRAN_TC_FACTOR_CONVERSION WHERE CV_TIPO_FACTOR = ''04'' AND FC_VALOR_FACTOR = PARSEDATETIME(?3,''DD/MM/YYYY'') )*NU_MONTO_VIVIENDA97) ELSE 0.00 END) ) NU_MONTO_VIVIENDA92 FROM RETI_TR_MOVIMIENTO_IMSS INNER JOIN NSAR_TC_AFORE af ON CH_AFORE = af.CV_AFORE where TRUNC(FC_MOVIMIENTO) BETWEEN PARSEDATETIME(?1,''DD/MM/YYYY'') AND PARSEDATETIME(?2,''DD/MM/YYYY'') AND CV_MOVIMIENTO_IMSS IN (''220'',''294'') AND CH_DIAGNOSTICO_RCV  IN (''501'',''590'') GROUP BY CH_AFORE || '' - ''|| af.CH_DESC_AFORE ORDER BY CH_AFORE || '' - ''|| af.CH_DESC_AFORE )mov ON trans.cv_afore = mov.cv_af ORDER BY cv_afore ASC','PROCNSARD','chAfore, nuRet97Tra, nuCvCuotaEstaTra, nuCuotaSoTra, nuRet92ImssTra, nuViv97Tra, nuPartViv97Inf,   nuMontoRetiro97, nuMontoCv, nuMontoCuotaSocial, nuMontoRetiro92, nuMontoVivienda97, nuPartViv97InfMov',0,0,0,0,PARSEDATETIME('14/01/20','DD/MM/YY'),'HJRAMIRE',1029,4,null,'');
INSERT INTO PSER_TC_REPORTE_GENERICO (ID_REPORTE_GENERICO,ID_SUBPROCESO,ID_TIPO_REPORTE,CH_NOMBRE_REPORTE,NU_ACTIVO,CH_CONSULTA,CH_ESQUEMA,CH_ENCABEZADO,NU_FILTRO_NSS,NU_FILTRO_CURP,NU_FILTRO_RANGO_FC,NU_FILTRO_ID_PROCESAR,FC_CONTROL,CH_USUARIO_MODIFICADOR,ID_REPORTE_GENERICO_PADRE,NU_ORDEN,CH_NOMBRE_ARCHIVO_REPORTE, CH_URL) VALUES (1032,910,3194,'SUBREPORT_DATA_REPORTE_BRJP',1,'select /*+PARALLEL(5)*/ cv_afore  AS chAfore, ''0.00'' AS nuRet97Tra, trans.NU_CV_CUOTA_ESTA_TRA AS nuCvCuotaEstaTra, trans.NU_CUOTA_SO_TRA AS nuCuotaSoTra, ''0.00'' AS nuRet92ImssTra, ''0.00'' AS nuViv97Tra, ''0.00'' AS nuPartViv97Inf, ''0.00'' AS nuMontoRetiro97, mov.NU_MONTO_CV AS nuMontoCv, mov.NU_MONTO_CUOTA_SOCIAL AS nuMontoCuotaSocial, ''0.00'' AS nuMontoRetiro92, ''0.00'' AS nuMontoVivienda97, ''0.00'' AS nuPartViv97InfMov from ( select /*+PARALLEL(5)*/CONCAT(CONCAT(ta.cv_afore,'' - ''),ta.CH_DESC_AFORE) as cv_afore, sum( ct.NU_RET97_TRA) NU_RET97_TRA, sum( ct.NU_CV_CUOTA_ESTA_TRA) NU_CV_CUOTA_ESTA_TRA, sum( ct.NU_CUOTA_SO_TRA )NU_CUOTA_SO_TRA, sum( ct.NU_RET92_IMSS_TRA) NU_RET92_IMSS_TRA, sum( ct.NU_VIV_97_TRA ) NU_VIV_97_TRA, sum( ct.NU_PART_VIV97_INF ) NU_PART_VIV97_INF from RETI_TR_CONF_TRANSFERENCIA ct inner join NSAR_TC_AFORE ta on ct.id_procesar_afore= ta.id_procesar where TRUNC(FC_LIQUIDACION) BETWEEN PARSEDATETIME(?1,''DD/MM/YYYY'') AND PARSEDATETIME(?2,''DD/MM/YYYY'') and ct.NU_RJP = ''1'' and CH_DIAGNOSTICO_AFORE IN (''501'',''590'') and CV_TIPO_RETIRO = ''B'' group by CONCAT(CONCAT(ta.cv_afore,'' - ''),ta.CH_DESC_AFORE) ) trans left join ( select /*+PARALLEL(5)*/CONCAT(CONCAT(CH_AFORE,'' - ''),af.CH_DESC_AFORE) as cv_af, sum( NU_MONTO_RETIRO97 ) NU_MONTO_RETIRO97, sum( NU_MONTO_CV ) NU_MONTO_CV, sum( NU_MONTO_CUOTA_SOCIAL ) NU_MONTO_CUOTA_SOCIAL, sum( NU_MONTO_RETIRO92 ) NU_MONTO_RETIRO92, sum( NU_MONTO_VIVIENDA97 ) NU_MONTO_VIVIENDA97, sum( ( select /*+PARALLEL(5)*/NU_VALOR_FACTOR from TRAN_TC_FACTOR_CONVERSION where CV_TIPO_FACTOR = ''04'' and FC_VALOR_FACTOR = PARSEDATETIME(?3,''DD/MM/YYYY'') )*NU_MONTO_VIVIENDA97 ) NU_MONTO_VIVIENDA92 from RETI_TR_MOVIMIENTO_IMSS inner join NSAR_TC_AFORE af on CH_AFORE = af.CV_AFORE where TRUNC(FC_MOVIMIENTO) BETWEEN PARSEDATETIME(?1,''DD/MM/YYYY'') AND PARSEDATETIME(?2,''DD/MM/YYYY'') and CV_MOVIMIENTO_IMSS IN (''270'',''293'') and CH_DIAGNOSTICO_RCV IN (''501'',''590'') group by CONCAT(CONCAT(CH_AFORE,'' - ''),af.CH_DESC_AFORE) order by CONCAT(CONCAT(CH_AFORE,'' - ''),af.CH_DESC_AFORE) ) mov on trans.cv_afore = mov.cv_af ORDER BY cv_afore asc','PROCNSARD','CHAFORE,NURET97TRA,NUCVCUOTAESTATRA,NUCUOTASOTRA,NURET92IMSSTRA,NUVIV97TRA,NUPARTVIV97INF,NUMONTORETIRO97,NUMONTOCV,NUMONTOCUOTASOCIAL,NUMONTORETIRO92,NUMONTOVIVIENDA97,NUPARTVIV97INFMOV',0,0,0,0,PARSEDATETIME('14/01/20','DD/MM/YY'),'HJRAMIRE',1029,3,null,'');
INSERT INTO PSER_TC_REPORTE_GENERICO (ID_REPORTE_GENERICO,ID_SUBPROCESO,ID_TIPO_REPORTE,CH_NOMBRE_REPORTE,NU_ACTIVO,CH_CONSULTA,CH_ESQUEMA,CH_ENCABEZADO,NU_FILTRO_NSS,NU_FILTRO_CURP,NU_FILTRO_RANGO_FC,NU_FILTRO_ID_PROCESAR,FC_CONTROL,CH_USUARIO_MODIFICADOR,ID_REPORTE_GENERICO_PADRE,NU_ORDEN,CH_NOMBRE_ARCHIVO_REPORTE, CH_URL) VALUES (1031,910,3194,'SUBREPORT_DATA_REPORTE_B',1,'SELECT /*+PARALLEL(5)*/CV_AFORE AS CHAFORE, ''0.00'' AS NURET97TRA, TRANS.NU_CV_CUOTA_ESTA_TRA AS NUCVCUOTAESTATRA, TRANS.NU_CUOTA_SO_TRA AS NUCUOTASOTRA, ''0.00'' AS NURET92IMSSTRA, TRANS.NU_VIV_97_TRA AS NUVIV97TRA, ''0.00'' AS NUPARTVIV97INF, ''0.00'' AS NUMONTORETIRO97, MOV.NU_MONTO_CV AS NUMONTOCV, MOV.NU_MONTO_CUOTA_SOCIAL AS NUMONTOCUOTASOCIAL,  ''0.00'' AS NUMONTORETIRO92, MOV.NU_MONTO_VIVIENDA97 AS NUMONTOVIVIENDA97, ''0.00'' AS NUPARTVIV97INFMOV  FROM  ( SELECT /*+PARALLEL(5)*/CONCAT(CONCAT(TA.CV_AFORE,'' - ''),TA.CH_DESC_AFORE) AS CV_AFORE, SUM( CT.NU_RET97_TRA) NU_RET97_TRA, SUM( CT.NU_CV_CUOTA_ESTA_TRA) NU_CV_CUOTA_ESTA_TRA, SUM( CT.NU_CUOTA_SO_TRA )NU_CUOTA_SO_TRA,  SUM( CT.NU_RET92_IMSS_TRA) NU_RET92_IMSS_TRA, SUM( CT.NU_VIV_97_TRA ) NU_VIV_97_TRA, SUM( CT.NU_PART_VIV97_INF ) NU_PART_VIV97_INF FROM RETI_TR_CONF_TRANSFERENCIA CT INNER JOIN NSAR_TC_AFORE TA ON CT.ID_PROCESAR_AFORE= TA.ID_PROCESAR WHERE TRUNC(FC_LIQUIDACION) BETWEEN PARSEDATETIME(?1,''DD/MM/YYYY'') AND PARSEDATETIME(?2,''DD/MM/YYYY'') AND CT.NU_RJP = ''0''  AND CH_DIAGNOSTICO_AFORE IN (''501'',''590'') AND CV_TIPO_RETIRO = ''B'' GROUP BY CONCAT(CONCAT(TA.CV_AFORE,'' - ''),TA.CH_DESC_AFORE)  ) TRANS  LEFT JOIN  ( SELECT /*+PARALLEL(5)*/CONCAT(CONCAT(CH_AFORE,'' - ''),AF.CH_DESC_AFORE) AS CV_AF, SUM( NU_MONTO_RETIRO97 ) NU_MONTO_RETIRO97, SUM( NU_MONTO_CV ) NU_MONTO_CV, SUM( NU_MONTO_CUOTA_SOCIAL ) NU_MONTO_CUOTA_SOCIAL,  SUM( NU_MONTO_RETIRO92 ) NU_MONTO_RETIRO92, SUM( NU_MONTO_VIVIENDA97 ) NU_MONTO_VIVIENDA97, SUM( (  SELECT /*+PARALLEL(5)*/NU_VALOR_FACTOR FROM TRAN_TC_FACTOR_CONVERSION WHERE CV_TIPO_FACTOR = ''04''   AND FC_VALOR_FACTOR = PARSEDATETIME(?3,''DD/MM/YYYY'') )*NU_MONTO_VIVIENDA97  ) NU_MONTO_VIVIENDA92  FROM RETI_TR_MOVIMIENTO_IMSS INNER JOIN NSAR_TC_AFORE AF ON CH_AFORE = AF.CV_AFORE  WHERE TRUNC(FC_MOVIMIENTO) BETWEEN PARSEDATETIME(?1,''DD/MM/YYYY'') AND PARSEDATETIME(?2,''DD/MM/YYYY'') AND CV_MOVIMIENTO_IMSS IN (''210'',''292'')  AND CH_DIAGNOSTICO_RCV IN (''501'',''590'') GROUP BY CONCAT(CONCAT(CH_AFORE,'' - ''),AF.CH_DESC_AFORE)  ORDER BY CONCAT(CONCAT(CH_AFORE,'' - ''),AF.CH_DESC_AFORE)  ) MOV  ON TRANS.CV_AFORE = MOV.CV_AF  ORDER BY CV_AFORE ASC','PROCNSARD','CHAFORE,NURET97TRA,NUCVCUOTAESTATRA,NUCUOTASOTRA,NURET92IMSSTRA,NUVIV97TRA,NUPARTVIV97INF,NUMONTORETIRO97,NUMONTOCV,NUMONTOCUOTASOCIAL,NUMONTORETIRO92NUMONTOVIVIENDA97,NUPARTVIV97INFMOV',0,0,0,0,PARSEDATETIME('14/01/20','DD/MM/YY'),'HJRAMIRE',1029,2,null,'');
INSERT INTO PSER_TC_REPORTE_GENERICO (ID_REPORTE_GENERICO,ID_SUBPROCESO,ID_TIPO_REPORTE,CH_NOMBRE_REPORTE,NU_ACTIVO,CH_CONSULTA,CH_ESQUEMA,CH_ENCABEZADO,NU_FILTRO_NSS,NU_FILTRO_CURP,NU_FILTRO_RANGO_FC,NU_FILTRO_ID_PROCESAR,FC_CONTROL,CH_USUARIO_MODIFICADOR,ID_REPORTE_GENERICO_PADRE,NU_ORDEN,CH_NOMBRE_ARCHIVO_REPORTE, CH_URL) VALUES (1030,910,3194,'SUBREPORT_DATA_REPORTE_A',1,'SELECT /*+PARALLEL(5)*/cv_afore AS chAfore, trans.NU_RET97_TRA AS nuRet97Tra, trans.NU_CV_CUOTA_ESTA_TRA AS nuCvCuotaEstaTra, trans.NU_CUOTA_SO_TRA AS nuCuotaSoTra, ''0.00'' AS nuRet92ImssTra, trans.NU_VIV_97_TRA AS nuViv97Tra, trans.NU_PART_VIV97_INF AS nuPartViv97Inf, mov.NU_MONTO_RETIRO97 AS nuMontoRetiro97, mov.NU_MONTO_CV AS nuMontoCv, mov.NU_MONTO_CUOTA_SOCIAL AS nuMontoCuotaSocial, ''0.00'' AS nuMontoRetiro92, mov.NU_MONTO_VIVIENDA97  AS nuMontoVivienda97, mov.NU_MONTO_VIVIENDA92  AS nuPartViv97InfMov FROM (  SELECT /*+PARALLEL(5)*/(ta.cv_afore || '' - '' || ta.CH_DESC_AFORE) AS cv_afore, SUM( ct.NU_RET97_TRA) NU_RET97_TRA, SUM( ct.NU_CV_CUOTA_ESTA_TRA) NU_CV_CUOTA_ESTA_TRA, SUM( ct.NU_CUOTA_SO_TRA )NU_CUOTA_SO_TRA, SUM( ct.NU_RET92_IMSS_TRA) NU_RET92_IMSS_TRA, SUM( (CASE ct.CV_ESTATUS_VIVIENDA WHEN ''1'' THEN ct.NU_VIV_97_TRA ELSE 0.00 END) ) NU_VIV_97_TRA, SUM( (CASE ct.CV_ESTATUS_VIVIENDA WHEN ''1'' THEN ct.NU_PART_VIV97_INF ELSE 0.00 END) ) NU_PART_VIV97_INF  FROM RETI_TR_CONF_TRANSFERENCIA ct  INNER JOIN NSAR_TC_AFORE ta  ON ct.id_procesar_afore = ta.id_procesar  WHERE TRUNC(FC_LIQUIDACION) BETWEEN PARSEDATETIME(?1,''DD/MM/YYYY'') AND PARSEDATETIME(?2,''DD/MM/YYYY'')  AND CH_DIAGNOSTICO_AFORE IN (''501'',''590'')  AND CV_TIPO_RETIRO  = ''A''  GROUP BY (ta.cv_afore || '' - '' || ta.CH_DESC_AFORE)  ) trans  left join (  SELECT /*+PARALLEL(5)*/CH_AFORE || '' - ''|| af.CH_DESC_AFORE AS cv_af, SUM( NU_MONTO_RETIRO97 ) NU_MONTO_RETIRO97, SUM( NU_MONTO_CV ) NU_MONTO_CV, SUM( NU_MONTO_CUOTA_SOCIAL ) NU_MONTO_CUOTA_SOCIAL, SUM( NU_MONTO_RETIRO92 ) NU_MONTO_RETIRO92, SUM( (CASE CH_RESULTADO_VIVIENDA WHEN ''01'' THEN NU_MONTO_VIVIENDA97 ELSE 0.00 END)) NU_MONTO_VIVIENDA97, SUM( (CASE CH_RESULTADO_VIVIENDA WHEN ''01'' THEN ((SELECT /*+PARALLEL(5)*/NU_VALOR_FACTOR FROM TRAN_TC_FACTOR_CONVERSION WHERE CV_TIPO_FACTOR = ''04'' AND FC_VALOR_FACTOR = PARSEDATETIME(?3,''DD/MM/YYYY'') )*NU_MONTO_VIVIENDA97) ELSE 0.00 END) ) NU_MONTO_VIVIENDA92  FROM RETI_TR_MOVIMIENTO_IMSS  INNER JOIN NSAR_TC_AFORE af  ON CH_AFORE = af.CV_AFORE  WHERE TRUNC(FC_MOVIMIENTO) BETWEEN PARSEDATETIME(?1,''DD/MM/YYYY'') AND PARSEDATETIME(?2,''DD/MM/YYYY'')  AND CV_MOVIMIENTO_IMSS IN (''220'',''291'')  AND CH_DIAGNOSTICO_RCV IN (''501'',''590'')  GROUP BY CH_AFORE || '' - ''|| af.CH_DESC_AFORE  ORDER BY CH_AFORE || '' - ''|| af.CH_DESC_AFORE  )mov ON trans.cv_afore = mov.cv_af  ORDER BY cv_afore ASC','PROCNSARD','CHAFORE,NURET97TRA,NUCVCUOTAESTATRA,NUCUOTASOTRA,NURET92IMSSTRA,NUVIV97TRA,NUPARTVIV97INF,NUMONTORETIRO97,NUMONTOCV,NUMONTOCUOTASOCIAL,NUMONTORETIRO92,NUMONTOVIVIENDA97,NUPARTVIV97INFMOV',0,0,0,0,PARSEDATETIME('14/01/20','DD/MM/YY'),'HJRAMIRE',1029,1,null,'');
