-- PSER_TR_USER_ROL_PULSSAR
SELECT PSER_SEQ_USER_ROL_PULSSAR.NEXTVAL, '1' AS NU_ESTATUS, SYSDATE AS FC_CONTROL, 'ADMINISTRADOR' AS CH_USUARIO_MODIFICADOR,
UP.ID_USUARIO_PULSSAR, RP.ID_ROL_PULSSAR 
FROM PSER_TR_USUARIO_PULSSAR UP
INNER JOIN PSER_TC_ROL_PULSSAR RP ON UP.CV_ORGANIZACION = RP.CH_AFORE
WHERE  RP.CV_ROL_PULSSAR = '05' AND UP.CV_ORGANIZACION != '999' AND UP.CH_USUARIO NOT LIKE '%@%';

SELECT PSER_SEQ_USER_ROL_PULSSAR.NEXTVAL, '1' AS NU_ESTATUS, SYSDATE AS FC_CONTROL, 'ADMINISTRADOR' AS CH_USUARIO_MODIFICADOR,
UP.ID_USUARIO_PULSSAR, RP.ID_ROL_PULSSAR 
FROM PSER_TR_USUARIO_PULSSAR UP
INNER JOIN PSER_TC_ROL_PULSSAR RP ON UP.CV_ORGANIZACION = RP.CH_AFORE
WHERE  RP.CV_ROL_PULSSAR = '03' AND UP.CV_ORGANIZACION != '999' AND UP.CH_USUARIO LIKE '%@%';

SELECT PSER_SEQ_USER_ROL_PULSSAR.NEXTVAL, '1' AS NU_ESTATUS, SYSDATE AS FC_CONTROL, 'ADMINISTRADOR' AS CH_USUARIO_MODIFICADOR,
UP.ID_USUARIO_PULSSAR, RP.ID_ROL_PULSSAR 
FROM PSER_TR_USUARIO_PULSSAR UP
INNER JOIN PSER_TC_ROL_PULSSAR RP ON UP.CV_ORGANIZACION = RP.CH_AFORE
WHERE  RP.CV_ROL_PULSSAR = '01' AND UP.CV_ORGANIZACION = '999';

